import React, { useState, useEffect } from 'react';

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    fetch('/input.json')
        .then((response) => response.json())
        .then((data) => setData(data));
  }, []);

  if (!data) return <div>Loading...</div>;

  return (
      <div className="p-8">
        <FileRenderer data={data} />
      </div>
  );
}

export default App;
